schedule.scheduleJob('0 18 * * *', async function(){
  await robot.userRequest('下班提醒');

  const locations = ["作品展示区", "会议室", "会客厅", "员工办公区"];
  let hasPeople = false;

  for(let i = 0; i < locations.length; i++){
