      const isHuman = await robot.detectHuman();
      if(isHuman){
          hasPeople = true;
          await robot.speak('到点了，该吃饭了！');
          break;
      }
  }

  if(!hasPeople){
      await robot.speak('没有人，可以回去了！');
  }

  await robot.goto('起始位置');
});

